import React from 'react';
import { Link } from 'react-router-dom';
import './styles/navbar.css';

const Navbar = () => {
  // Inline styles to force transparency
  const transparentStyle = {
    background: 'transparent',
    backgroundColor: 'transparent',
    backgroundImage: 'none',
    boxShadow: 'none',
    border: 'none',
    padding: 0,
    margin: 0
  };

  return (
    <nav className="navbar-container" style={transparentStyle}>
      <div className="navbar-center" style={transparentStyle}>
        <ul className="nav-links" style={transparentStyle}>
          <li style={transparentStyle}>
            <Link to="/category/clothing" style={transparentStyle}>Clothing</Link>
          </li>
          <li style={transparentStyle}>
            <Link to="/category/vehicles" style={transparentStyle}>Vehicles</Link>
          </li>
          <li style={transparentStyle}>
            <Link to="/category/artwork" style={transparentStyle}>Artwork</Link>
          </li>
          <li style={transparentStyle}>
            <Link to="/category/audio" style={transparentStyle}>Audio</Link>
          </li>
          <li style={transparentStyle}>
            <Link to="/category/gaming" style={transparentStyle}>Gaming</Link>
          </li>
          <li style={transparentStyle}>
            <Link to="/category/premium" style={transparentStyle}>Premium</Link>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
